import React from 'react';
import Header from './components/Header'
import AtomSpinner from '@bit/bondz.react-epic-spinners.atom-spinner'
import './App.css';

function App() {
  return (
    <div className="App">
      <Header className="App-header"></Header>
        <AtomSpinner
          color='#fffff'>
          </AtomSpinner>
      />
    </div>
  );
}

export default App;
